  return (
    <div>
      <div>
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/post">Post</Link>
          </li>
          <li>
            <button>Sign In</button>
          </li>
        </ul>
      </div>
      <Outlet />
    </div>
  );
}

export default App;
